The fix addresses the SQL injection vulnerability by replacing the use of Statement with PreparedStatement and parameterizing the query. The SQL query now uses a placeholder '?' instead of directly concatenating user input, and the parameter is set using preparedStatement.setString(). This prevents malicious user input from altering the structure of the SQL query, effectively mitigating the risk of SQL injection attacks.
```suggestion
package detectors.sql_injection;

import javax.servlet.http.HttpServletRequest;
import java.sql.PreparedStatement; // import PreparedStatement

public class SqlInjection {

    // {fact rule=sql-injection@v1.0 defects=1}
    public void executeSqlStatementNoncompliant(HttpServletRequest request, java.sql.Connection connection) {
        final String favoriteColor = request.getParameter("favoriteColor");
        try {
            String sql = "SELECT * FROM people WHERE favorite_color=?";
            PreparedStatement preparedStatement = connection.prepareStatement(sql);
            preparedStatement.setString(1, favoriteColor);
            // Compliant: user-given input is now parameterized.
            preparedStatement.execute();
        } catch (java.sql.SQLException e) {
            throw new RuntimeException(e);
        }
    }
